import "./Hotel.css";
import dataHotel from "../../../../data/hotel_list.json";
const Hotel = () => {
  console.log(dataHotel);
  return (
    <div>
      <h2>Homes guests love</h2>
      {dataHotel.map((item, index) => {
        <div key={index}>
          <img src={item.image_url}></img>
          <p>{item.city}</p>
          <h3>Starting from ${item.price}</h3>
          <div>
            <p>{item.rate}</p>
            <p>{item.type}</p>
          </div>
        </div>;
      })}
    </div>
  );
};
export default Hotel;
